import { Component } from "react";

class Titulo extends Component{
    render(){
        return(
            <thead>
                <th class="dr">Concepto</th>
                <th class="dr">Monto</th>
                <th class="dr">Tipo</th>
                <th class="dr">Fecha</th>
                <th class="dr">Categorida</th>
                <th class="dr"></th>
                <th class="dr"></th>
            </thead>
        )
    }
}
export default Titulo;
